import React from 'react'
import ReactDOM from 'react-dom'

const AppHeader = () => {
  return (
    <h1>Todo Aoo</h1>
  );
};

const AppSearch = () => {
  return ( 
    <input type="text" name="" id="" placeholder="SOME"/>
  );
};

const AppList = () => {
  return (
    <ul>
      <li>Learn React</li>
      <li>My awesome app</li>
      <li>Bye</li>
    </ul>
  );
};

const App = () => {
  return (
    <div>
      <AppHeader/>
      <AppSearch/>
      <AppList/>
    </div>    
  );
};

const el = (
  <div>
    <h1>Todo Aoo</h1>

    <ul>
      <li>Learn React</li>
      <li>My awesome app</li>
      <li>Bye</li>
    </ul>
  </div>
);

ReactDOM.render(el, document.getElementById('root'));
